import React from 'react';
import styled from 'styled-components';

function SkeletonTopBanner() {
	return <ComponentWrapper />;
}
const ComponentWrapper = styled.div`
	width: 100%;
	display: inline-block;
	filter: brightness(50%);
	padding: 0 12px;
	float: left;
	width: 1060px;
	padding-bottom: 28.3%;
	.box-img-wrapper {
		border: 1px solid black;
		position: relative;
		div {
			display: inline-block;
			position: absolute;
			left: 0;
			right: 0;
			width: 100%;
			height: 100%;
			border-radius: 4px;
			object-fit: cover;
		}
	}

	.btn-endicon {
		margin-top: -2px;
		margin-right: -1px;
		margin-left: 2px;
	}
`;

export default SkeletonTopBanner;
